import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

import { useForm } from '../Redux/FormContext';

const AcademicForm = () => {
    const { formData, updateFormData } = useForm();
    const navigate = useNavigate();

    const [academicForms, setAcademicForms] = useState([
        { degree:'', course: '', institution: '', startYear: '', endYear:'', gpaScored:'', gpaOutOf:'' },
      ]);

      const addAcademicForm = () => {
        setAcademicForms([...academicForms, { degree:'', course: '', institution: '', startYear: '', endYear:'', gpaScored:'', gpaOutOf:'' }]);
      };

      const handleInputChange = (index, event) => {
        const { name, value } = event.target;
        const updatedForms = [...academicForms];
        updatedForms[index][name] = value;
        setAcademicForms(updatedForms);
      };

      const print = () => {
        updateFormData('AcademicForm', academicForms);
        console.log(formData);
      }

    return(
        <div className='container'>
            <div>
            {academicForms.map((form, index) => (
                <div key={index}>
                    <label className='label-style'>
                        Institution:
                        <input
                        type="text"
                        name="institution"
                        value={form.institution}
                        onChange={(e) => handleInputChange(index, e)}
                        className='input-style'
                        placeholder='College/University/School'
                        />
                    </label>
                    <br />
                    <div className="input-group">
                        <div className="input-group-item">
                            <label className='label-style'>
                            Degree:
                            <input
                                type="text"
                                name="degree"
                                value={form.degree}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='Bachelors of Technology(B.TECH)'
                                required
                            />
                            </label>
                        </div>
                        <div className="input-group-item">
                            <label className='label-style'>
                            Course:
                            <input
                                type="text"
                                name="course"
                                value={form.course}
                                onChange={(e) => handleInputChange(index, e)}
                                className='input-style'
                                placeholder='Computer Science & Engineering(CSE)'
                            />
                            </label>
                        </div>
                    </div>
                    <label className='p-3'>
                    Institution:
                    <input
                    type="text"
                    name="institution"
                    value={form.institution}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                <br />
                <label className='p-3'>
                    Degree:
                    <input
                    type="text"
                    name="degree"
                    value={form.degree}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                <label className='p-3'>
                    Course:
                    <input
                    type="text"
                    name="course"
                    value={form.course}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                <br />
                <label className='p-3'>
                    Start year:
                    <input
                    type="text"
                    name="startYear"
                    value={form.startYear}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                <label className='p-3'>
                    End year:
                    <input
                    type="text"
                    name="endYear"
                    value={form.endYear}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                <br />
                <label className='p-3'>
                    GPA:
                    <input
                    type="text"
                    name="gpaScored"
                    value={form.gpaScored}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                <label className='p-3'>
                    Out of:
                    <input
                    type="text"
                    name="gpaOutOf"
                    value={form.gpaOutOf}
                    className='m-2'
                    onChange={(e) => handleInputChange(index, e)}
                    />
                </label>
                </div>
            ))}
            <button onClick={addAcademicForm}>Add Academic Form</button>
            <button onClick={() => navigate('/DescriptionInfo')}>Previous</button>
            <button onClick={print}>Print</button>
            </div>
        </div>
    )
}

export default AcademicForm;
